import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';




class PageListagem extends Component {



  render() {
    return (
      <>
        <ul className="list-group">

          {this.props.pessoas.map((pessoa, index) => {

            return (
              <li align="center" className="list-group-item" key={index}>
                {index + " =>" + " Email: " + pessoa.email + " Senha: " + `${pessoa.senha}`}
              </li>
            )

          })}

        </ul>

        <table class="table">
          <thead class="thead-dark">
            <tr>
              <th scope="col">#</th>
              <th scope="col">First</th>
              <th scope="col">Last</th>
              <th scope="col">Handle</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <th scope="row">1</th>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
            </tr>
            <tr>
              <th scope="row">2</th>
              <td>Jacob</td>
              <td>Thornton</td>
              <td>@fat</td>
            </tr>
            <tr>
              <th scope="row">3</th>
              <td>Larry</td>
              <td>the Bird</td>
              <td>@twitter</td>
            </tr>
          </tbody>
        </table>






      </>
    )
  }
}

export default PageListagem;
